import React, { Component } from "react";
import ReactDOM from "react-dom";
import ReactCardCarousel from "react-card-carousel";

class Play extends Component {
  static get CONTAINER_STYLE() {
    return {
      position: "relative",
      height: "100vh",
      width: "100%",
      display: "flex",
      flex: 0.3,
      justifyContent: "center",
      alignItems: "middle"
    };
  }

  static get CARD_STYLE() {
    return {
      height: "400px",
      width: "400px",
      paddingTop: "80px",
      paddingBottom: "80px",
      paddingLeft: "100px",
      paddingRight: "100px",
      textAlign: "center",
      color: "#000000",
      background: "#FFFF00",
      fontFamily: "avenir-black",
      fontSize: "35px",
      borderRadius: "10px",
      borderColor: 'black',
      boxSizing: "border-box"
    };
  }

  render() {
    return (
      <div>
      <h1 className='title'> honestly. </h1>
      <div style={Play.CONTAINER_STYLE}>
        <ReactCardCarousel autoplay={false} autoplay_speed={2500}>
          <div style={Play.CARD_STYLE}>What is your first impression</div>
          <div style={Play.CARD_STYLE}>What is my bamef chdscn cdhosc oahsdc </div>
          <div style={Play.CARD_STYLE}>Third Card</div>
          <div style={Play.CARD_STYLE}>Fourth Card</div>
          <div style={Play.CARD_STYLE}>Fifth Card</div>
        </ReactCardCarousel>
      </div>
      </div>
    );
  }
}

export default Play;
